import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets
import groovy.json.JsonSlurper
import groovy.json.JsonOutput

def media(lista) {
    if (!(lista instanceof List)) return null
    def validos = lista.findAll { it instanceof Number }
    return validos ? validos.sum() / validos.size() : null
}

flowFile = session.get()
if (flowFile != null) {
    try {
        def inputStream = session.read(flowFile)
        def conteudo = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
        inputStream.close()

        def json = new JsonSlurper().parseText(conteudo)

        // Se json for lista com um elemento, pega o elemento para simplificar
        if (json instanceof List && json.size() == 1 && json[0] instanceof Map) {
            json = json[0]
        }

        // Substitui os arrays pelas médias mantendo os demais campos intactos
        if (json.temperatura != null) json.temperatura = media(json.temperatura)
        if (json.precipitacao != null) json.precipitacao = media(json.precipitacao)
        if (json.probabilidade != null) json.probabilidade = media(json.probabilidade)
        if (json.visibilidade != null) json.visibilidade = media(json.visibilidade)
        if (json.cobertura != null) json.cobertura = media(json.cobertura)
        if (json.velocidade != null) json.velocidade = media(json.velocidade)
        if (json.direcao != null) json.direcao = media(json.direcao)

        def novoConteudo = JsonOutput.toJson(json)

        flowFile = session.write(flowFile, { outputStream ->
            outputStream.write(novoConteudo.getBytes(StandardCharsets.UTF_8))
        } as OutputStreamCallback)

        session.transfer(flowFile, REL_SUCCESS)

    } catch (e) {
        log.error("Erro ao processar JSON: " + e.message, e)
        session.transfer(flowFile, REL_FAILURE)
    }
}
